import './App.css';
import React , { useEffect, useState} from 'react'
import axios from 'axios'
function App() {
  const [pokemons, setPokemons] = useState([]);
  useEffect(() => {
    const data = axios.get('http://localhost:3002/pokemons')
    setPokemons(data)
    console.log(data)
  },[])

  return (
    <div className="App">
      {
        pokemons && pokemons.data.map(poke => (
          <p>{poke.name}</p>
        ))
      }
    </div>
  );
}

export default App;
